import React from 'react';
import styles from './PhoneInCall.module.css';

function PhoneInCall() {
  return (
    <div className={styles.container}>
      <h2 className={styles.callStatus}>The Device is not in call</h2>
    </div>
  );
}

export default PhoneInCall;
